import {  useSelector } from "react-redux";
import "./App.scss"
import BuscadorArea from "./buscador";



function App() {

  const datosBusqueda = useSelector(estado => estado.reductorBusqueda.contenidoBusqueda)





  return (
    <div className="App">

      <h1 className="custom-text-title text text-center text-primary ">Search App</h1>
      <BuscadorArea />
      <div className="image-container p-3 mt-3">
        {datosBusqueda.map((dato) => 
        (
          <div class="card" style={{width: "250px"}} id={dato.id}>
  <img className="card-img-top" src={dato.webformatURL} alt={"image made by: " + dato.user}/>
  <div className="card-body">

    <p className="card-text">{"comments: " + dato.comments}</p>

  </div>
</div>
        ))}
      </div>
    </div>
  );
}

export default App;
